library(shiny)
#library(ggplot2)

#options(shiny.maxRequestSize = 20 * 1024^2)
# 
source('R/peak_fitting_FM.R')
source('R/utils.R')
source('R/html_header_footer.R')

downloadButton <- function(...) {
  tag <- shiny::downloadButton(...)
  tag$attribs$download <- NULL
  tag
}

ui <- fluidPage(
  
  tags$head(
    tags$link(rel = "stylesheet", href = "nist-combined.css")
  ),
  
  tags$head(
    HTML(html_header)
  ),
  

    titlePanel("Atom Probe Adaptive Peak Fitting Tool"),

    sidebarLayout(
        sidebarPanel(
            radioButtons('upload_or_default','Upload File or Run Example?',
                         choices=c("Upload File",
                                   "Run Example File")),
            
            fileInput("inFile", "Upload Data (.csv)",
                      accept = c(
                          "text/csv",
                          "text/comma-separated-values,text/plain",
                          ".csv")
            ),
            
            numericInput('begin_range',"Range Start (Time of Flight)",value=NA),
            numericInput('end_range',"Range End (Time of Flight)",value=NA),
            br(),
            
            numericInput('background_limit','Background Limit',value=NA),
            br(),
            
            textInput('peak_positions','Peak Positions',placeholder = '100,150.24,200'),
            br(),
          
            uiOutput('which_peak_ui'),
            br(),
            
            numericInput('random_seed','Random Seed (for reproducibility)',value=sample.int(1000,1)),
            selectInput('hydride','Fit Hydride Peaks?',choices=c("No","Yes")),
            br(),
            
            actionButton('go','Fit Peaks'),
            br(),
            br()
        ),

        # Show a plot of the generated distribution
        mainPanel(
           plotOutput("initial_plot"),
           br(),
           plotOutput("results_plot"),
           br(),
           fluidRow(column(3,uiOutput("show_hide_totalfit"),offset=5)),
           br(),
           tableOutput('results_table'),
           br(),
           br(),
           uiOutput("download_button_ui"),
           br(),
           uiOutput("download_full_data_button_ui"),
           br(),
           br()
           
        )
    ),
  
  tags$div(HTML(html_footer))
)

# Define server logic required to draw a histogram
server <- function(input, output) {
  
    output$which_peak_ui = renderUI({

      if(length(peak_positions()) < 1) {
        return(NULL)
      }

      return(
        tagList(
          selectInput('which_peak',
                      'Which Peak should be the Reference Peak?',
                      choices=c(
                        'Default (algorithm to pick tallest peak)',
                        1:length(peak_positions())
                      )),
          p(paste0("The peak-fitting algorithm defaults to using the tallest ",
                   "peak as a guide to determining the peak shape. However, ",
                   "sometimes a different peak might be more isolated to provide ",
                   "better guidance to the algorithm, for example if the rightmost ",
                   "peak is relatively abundant and the tail of the main peak is hidden ",
                   "by other peaks."))
        )
      )

    })

    data = reactive({
      
      if(input$upload_or_default == 'Run Example File') {
        
        data = read.csv("example_data/R37_02888-v05_CorrectedTOF_AllEvents_01bins.csv", header = TRUE)
        
      } else if(is.null(input$inFile)) {
        
        return(NULL)
        
      } else {
        
        inFile = input$inFile
        data = read.csv(inFile$datapath, header = TRUE)

      }
      
      colnames(data) = c('tof','count')
      return(as.data.frame(data))

    })

    peak_positions = eventReactive(input$peak_positions, {

      pp_nospace = gsub('\\s','',input$peak_positions)

      return(as.numeric(strsplit(pp_nospace,',')[[1]]))

    })
    
    observeEvent(input$upload_or_default, {
      
      if(input$upload_or_default == 'Run Example File') {
        
        updateNumericInput(inputId='begin_range',
                           value=250)
        
        updateNumericInput(inputId='end_range',
                           value=270)
        
        updateNumericInput(inputId='background_limit',
                           value=252)
        
        updateTextInput(inputId = 'peak_positions',
                        value = '255.04,259.56,263.99')
        
      } else {
        
        updateNumericInput(inputId='begin_range',
                           value=NA)
        
        updateNumericInput(inputId='end_range',
                           value=NA)
        
        updateNumericInput(inputId='background_limit',
                           value=NA)
        
        updateTextInput(inputId = 'peak_positions',
                        value = NA)
        
      }
      
    })

    # plot to look at raw data
    output$initial_plot = renderPlot({
      
      if(any(is.null(input$begin_range),is.na(input$begin_range))) {
        return(NULL)
      }
      
      if(any(is.null(input$end_range),is.na(input$end_range))) {
        return(NULL)
      }
      
      if(is.null(input$inFile) & input$upload_or_default != 'Run Example File') {
        return(NULL)
      }
    
      if(is.null(data())) {
        return(NULL)
      }
      
      data = data()
      start = as.numeric(to_index(input$begin_range,data))
      end = as.numeric(to_index(input$end_range,data))
      data = data[start:end,]
      
      p = ggplot(data,aes(x=tof,y=(count)^(1/4) )) + geom_point() + ggtitle("Raw Data Plot") +
        ylab("Quartic Root of Count") +
        xlab("Time of Flight") +
        lucas_theme()
      
      if(!is.na(peak_positions()[1]) && !length(peak_positions()) < 1) {
        
        pp = peak_positions()
        
        for(ii in 1:length(pp)) {
          
          if(pp[ii] < input$begin_range || pp[ii] > input$end_range) {
            next
          }
          
          if(!is.null(input$which_peak) && input$which_peak == as.character(ii)) {
            the_col = 'red'
            
          } else {
            
            the_col = 'orange'
          }
          
          p = p + geom_vline(xintercept=pp[ii],col=the_col,linetype='dashed')
        }
        
      }
      
      
      if(!is.na(input$background_limit)) {
        p = p + geom_vline(xintercept = input$background_limit,col='green',linetype='dashed')
      }
      
      return(p)
        

        

    })

    # runs the procedure when the user clicks go
    optimized_peaks = eventReactive(input$go, {
      
        # use uploaded file and selected inputs
        
        if(is.null(data()$tof)) {
          return(NULL)
        }
        
        pp = peak_positions()
        data = data()
        
        b_start = rep(1,length(pp))
        which_x = rep(1,length(pp))
        
        for(ii in 1:length(pp)) {
          which_x[ii] = which.min(abs(data$tof - pp[ii]))
        }
        
        set.seed(input$random_seed)
        
        # convert from time of flight to index
        br = to_index(input$begin_range,data)
        er = to_index(input$end_range,data)
        bl = to_index(input$background_limit,data) - br - 1
        
        which_peak = input$which_peak
        if(which_peak %in% as.character(c(1:10))) {
          
          which_peak = as.numeric(which_peak)
          
        } else {
          which_peak = NA
        }
          

        withProgress(expr={
            optimized_peaks = fit_peaks(spectrum_data = data,
                                         positions = pp,
                                         bkgd_limit = bl,
                                         begin_range = br,
                                         end_range = er,
                                         tail_type = 'None',
                                         fit_hydride_peaks = input$hydride == 'Yes',
                                         which_main_peak = which_peak,
                                         n_iter = 5)
        },
        message = "Fitting Peaks...",value=.5)

        return(optimized_peaks)

    })

    output$show_hide_totalfit = renderUI({

      if(is.null(optimized_peaks()$peak_object)) {
        return(NULL)
      }

      return(
        radioButtons(
          'show_hide_radio',
          label="Plot to Display",
          choices=c("Total Fit","Individual Peaks","Residuals"),
          selected="Total Fit"
        )
      )
    })

    # plots results when optimized_peaks changes
    output$results_plot <- renderPlot({

      if(is.null(input$show_hide_radio)) {
          return(NULL)
      }


      if(input$show_hide_radio == 'Total Fit') {
        return(
          plot.peak(optimized_peaks(), type="fit", trans=function(x) x**(1/4), plot_total_fit=TRUE)
        )

      } else if(input$show_hide_radio == 'Individual Peaks') {
        return(
          plot.peak(optimized_peaks(), type="fit", trans=function(x) x**(1/4), plot_total_fit=FALSE)
        )

      } else {
        plot.peak(optimized_peaks(), type='residual')
      }

    })

    # relative abundance info
    output$results_table = renderTable({

      res = optimized_peaks()

      outdf = create_out_table(res)

      return(outdf)

    },options=list(searching=F,paging=F,ordering=F))

    output$downloadFullData = downloadHandler(
      filename = function() {
        'Full_Results.csv'
      },

      content = function(file) {

        res = optimized_peaks()

        outdf = as.data.frame(t(res$peak_object$spectra_results))

        colnames(outdf) = paste0("Peak",1:ncol(outdf))

        br = res$peak_object$begin_range
        er = res$peak_object$end_range

        tof_df = data.frame(time_of_flight = res$peak_object$spectrum_data[br:er,1])

        outdf = cbind(tof_df,outdf)
        outdf$residuals = res$peak_object$final_resid
        outdf$empirical_spectrum = res$peak_object$R_sub_bkgd

        write.csv(outdf, file, row.names = FALSE)

      }
    )

    output$downloadData <- downloadHandler(
      filename = function() {
        'Results_Table.csv'
      },
      content = function(file) {

        res = optimized_peaks()

        n_peaks = length(res$new_pos)

        tofs = res$peak_object$spectrum_data[res$peak_object$begin_range:res$peak_object$end_range,][res$new_pos,1]

        outdf = data.frame('pi'=round(res$new_pos,0),
                           'pltof'=round(as.vector(tofs),2),
                           'ra'=round(res$par[1:n_peaks]/sum(res$par[1:n_peaks]),5),
                           'ph'=round(res$par[1:n_peaks],5),
                           'sf'=res$peak_object$max_channel)

        colnames(outdf) = c("Peak Index","Peak Location (Time of Flight)","Relative Abundance","Peak Heights (Scaled)","Normalization Factor")

        write.csv(outdf, file, row.names = FALSE)
      }
    )

    output$download_button_ui = renderUI({

      if(is.null(optimized_peaks()$peak_object)) {
        return(NULL)

      } else {
        return(downloadButton("downloadData", "Download Results Table"))
      }

    })

    output$download_full_data_button_ui = renderUI({

      if(is.null(optimized_peaks()$peak_object)) {
        return(NULL)

      } else {
        return(downloadButton("downloadFullData", "Download All Peak Fits"))
      }

    })
}

# Run the application 
shinyApp(ui = ui, server = server)

fit_lp = function(R,positions_index,peak_heights,hydride_peaks,scaling_factor,
                  constrain_slope=FALSE,
                  constrain_mono=FALSE,
                  constrain_bkgd=FALSE) {
  
  n_beta = length(R)
  
  # first n_beta columns are the actual parameters;
  # second correspond to the residuals
  
  # b_i - t_i < y_i
  # aka, residual := b_i - y_i < t_i
  con_top = cbind(diag(1,nrow=n_beta,ncol=n_beta),diag(-1,nrow=n_beta,ncol=n_beta))
  
  y = R
  rel_peaks = peak_heights
  
  peak_to_end = length(R) - positions_index[1]
  
  for(ii in 2:length(positions_index)) {
    
    if(positions_index[ii] > positions_index[1]) {
      
      peak_start = positions_index[ii] - positions_index[1]
      
      the_ind = 1
      
      for(jj in peak_start:n_beta) {
        con_top[jj,the_ind] = rel_peaks[ii] 
        the_ind = the_ind + 1
      }
      
    } else {
      
      peak_diff = positions_index[1] - positions_index[ii]
      
      the_ind = 1
      
      for(jj in peak_diff:n_beta) {
        con_top[the_ind,jj] = rel_peaks[ii] 
        the_ind = the_ind + 1
      }
      
      
    }
    

  }

  # -b_i - t_i < -y_i
  # aka, (y_i - b_i) < t_i
  con_bottom = cbind(-con_top[1:n_beta,1:n_beta],diag(-1,nrow=n_beta,ncol=n_beta))
  
  # all vals greater than bkgd
  con_bkgd = cbind(diag(-1,n_beta,n_beta),diag(0,n_beta,n_beta))
  
  con_sum = cbind(con_top[1:n_beta,1:n_beta],diag(0,n_beta,n_beta))
  
  ub = (y*scaling_factor + 3*sqrt(y*scaling_factor))/scaling_factor
  lb = (y*scaling_factor - 3*sqrt(y*scaling_factor))/scaling_factor
  
  f.obj = c(rep(0,n_beta),rep(1,n_beta))
  f.dir = rep("<",n_beta*2)
  f.rhs = c(y, -y)
  con_full = rbind(con_top,
                   con_bottom)
  
  if(constrain_bkgd) {
    f.rhs = c(f.rhs,rep(-exp(-20),length(y)) )
    f.dir = c(f.dir,rep("<",n_beta))
    con_full = rbind(con_full,con_bkgd)
  }
  
  
  # monotonic constraints
  if(constrain_mono) {
    
    con_mono = matrix(0,ncol=n_beta*2,nrow=n_beta)
    
    min_index = 1
    
    for(ii in 2:(positions_index[1]-1)) {
      
      if(!hydride_peaks[ii] && !hydride_peaks[ii-1]) {
        con_mono[ii,(ii-1):ii] = c(1,-1)
        
      } else if (hydride_peaks[ii] && !hydride_peaks[ii-1]){
        min_index = ii-1
        
      } else if (hydride_peaks[ii] && hydride_peaks[ii-1]) {
        con_mono[ii,c(min_index,ii)] = c(1,-1)
        
      } else if (!hydride_peaks[ii] && hydride_peaks[ii-1]) {
        con_mono[ii,c(min_index,ii)] = c(1,-1)
        
      }
        
    }
    
    min_index = n_beta
    
    for(ii in (n_beta-1):(positions_index[1]+1) ) {
      
      if(!hydride_peaks[ii] && !hydride_peaks[ii+1]) {
        con_mono[ii,ii:(ii+1)] = c(-1,1)
        
      } else if(hydride_peaks[ii] && !hydride_peaks[ii+1]) {
        min_index = ii+1
        
      } else if (hydride_peaks[ii] && hydride_peaks[ii+1]) {
        con_mono[ii,c(min_index,ii)] = c(1,-1)
        
      } else if (!hydride_peaks[ii] && hydride_peaks[ii+1]) {
        con_mono[ii,c(ii,ii+1)] = c(-1,1)
      }
      
    }
    
    f.dir = c(f.dir,rep("<=",n_beta))
    f.rhs = c(f.rhs, rep(0,length(y)))
    con_full = rbind(con_full, con_mono)
    
  }
  
  
  # increasing slopes after right of peak

  if(constrain_slope) {
    
    slope_constraint = matrix(0,nrow=n_beta,ncol=n_beta*2)
    
    pad = round(length(R)/20)
  
    for(ii in (positions_index[1]+pad):(n_beta-2) ) {
       slope_constraint[ii,ii:(ii+2)] = c(-1,2,-1)
    }
  
    #for(ii in 3:(positions_index[1]-pad) ) {
    #  slope_constraint[ii,(ii-2):ii] = c(-1,2,-1)
    #}
  
    #slope_constraint[hydride_peaks,1:n_beta] = 0

    f.dir = c(f.dir,rep("<=",n_beta))
    f.rhs = c(f.rhs,rep(0,length(y)))
    con_full = rbind(con_full,slope_constraint)
    
  } 
  
  res = lp("min", f.obj, con_full, f.dir, f.rhs,scale=10000)
  
  res$solution = res$solution[1:n_beta]
  
  res = list(solution=res$solution,status=res$status)

  
  return(res)
  
}



get_total_fit = function(res,R,positions_index,peak_heights) {
  
  peak_starts = rep(0,length(positions_index))
  peak_ends = rep(0,length(positions_index))
  n_beta = length(R)
  
  
  for(ii in 2:length(positions_index)) {
    
    if(positions_index[ii] > positions_index[1]) {
      the_diff = positions_index[1]-1
      peak_starts[ii] = positions_index[ii] - the_diff
      peak_ends[ii] = length(R)
      
    } else {
      the_diff = length(R) - positions_index[1]
      peak_starts[ii] = 1
      peak_ends[ii] = positions_index[ii] + the_diff
    }
    
    
  }
  
  n_beta = length(res$solution)
  
  the_preds = matrix(0,nrow=length(positions_index),ncol=n_beta)
  
  the_preds[1,] = res$solution
  
  for(ii in 2:length(peak_starts)){
    
    t_inds = peak_starts[ii]:peak_ends[ii]
    
    if(positions_index[ii] > positions_index[1]) {
      the_preds[ii,t_inds] = (res$solution[1:length(t_inds)])*(peak_heights[ii])
      
    } else {
      the_preds[ii,t_inds] = (res$solution[(n_beta-length(t_inds)+1):n_beta])*(peak_heights[ii])
    }
    
  }
  
  return(list(total_fit=colSums(the_preds),all_preds=the_preds))
  
}
  

gradient.eq <- function(theta, R, n_peaks, n, channel_numbers, scaling_factors,max_channel) {
  # Gradient function for the peak shape optimization
  offpeakterms<-vector(mode="numeric", length=n)
  B <- theta[1:(n_peaks)]
  r_terms<-matrix(0, nrow=n_peaks, ncol=n)
  
  SResults<-matrix(0, nrow=n_peaks, ncol=n)
  
  gradients<-rep(0, (n+n_peaks))
  p <- H.Result(theta, n_peaks, n, channel_numbers)
  r<-(R-p) # residual
  
  # find unscaled channel intensities for each component peak
  for (i in 1:n_peaks) {
    for (j in 1:n){
      if (channel_numbers[i,j]==0){
        SResults[i,j]<- 0
      } else {
        SResults[i,j]<-p[channel_numbers[i,j]]
      } 
    }
  }
  
  # determine gradient components associated with the scaling factors, B
  gradients[1]<-0
  for (i in 2:n_peaks){
    for (j in 1:n){
      gradients[i]<-gradients[i]+(-2)*(r[j]*scaling_factors[j])*(SResults[i,j]) # do not divide by B here
    }
    
  }
  
  
  # determine the gradient components associated with the reference peak channels
  for (i in (1:n_peaks)){
    for (j in (1:n)){
      if (channel_numbers[i,j]==0){
        r_terms[i,j]<-0
      } else {
        r_terms[i,j]<-r[channel_numbers[i,j]]
      }
    }
  }
  
  for (i in (1:n)){
    for (j in 2:n_peaks){
      offpeakterms[i] <- (-2*r_terms[j,i]*scaling_factors[i])*B[j]
    }
  }
  
  for (i in (n_peaks+1):(n+n_peaks)){
    gradients[i]<-((-2*r[(i-n_peaks)]*scaling_factors[i-n_peaks])+(offpeakterms[(i-n_peaks)]))
  }
  
  
  return(max_channel*gradients)
}


gradient_eq_B <- function(theta, R, n_peaks, n, channel_numbers, scaling_factors,max_channel) {
  # Gradient function for the peak shape optimization
  offpeakterms<-vector(mode="numeric", length=n)
  B <- theta[1:(n_peaks)]
  r_terms<-matrix(0, nrow=n_peaks, ncol=n)
  
  SResults<-matrix(0, nrow=n_peaks, ncol=n)
  
  gradients<-rep(0, (n+n_peaks))
  p <- H.Result(theta, n_peaks, n, channel_numbers)
  r<-(R-p) # residual
  
  # find unscaled channel intensities for each component peak
  for (i in 1:n_peaks) {
    for (j in 1:n){
      if (channel_numbers[i,j]==0){
        SResults[i,j]<- 0
      } else {
        SResults[i,j]<-p[channel_numbers[i,j]]
      } 
    }
  }
  
  # determine gradient components associated with the scaling factors, B
  gradients[1]<-0
  for (i in 2:n_peaks){
    for (j in 1:n){
      gradients[i]<-gradients[i]+(-2)*(r[j]*scaling_factors[j])*(SResults[i,j]) # do not divide by B here
    }
    
  }
  
  
  # determine the gradient components associated with the reference peak channels
  for (i in (1:n_peaks)){
    for (j in (1:n)){
      if (channel_numbers[i,j]==0){
        r_terms[i,j]<-0
      } else {
        r_terms[i,j]<-r[channel_numbers[i,j]]
      }
    }
  }
  
  for (i in (1:n)){
    for (j in 2:n_peaks){
      offpeakterms[i] <- (-2*r_terms[j,i]*scaling_factors[i])*B[j]
    }
  }
  
  for (i in (n_peaks+1):(n+n_peaks)){
    gradients[i] <- 0
  }
  
  
  return(max_channel*gradients)
}


H.Result <- function(theta, n_peaks, n, channel_numbers) {
  # Define function for total estimated spectrum
  
  # This function is used to compute the predictions of the spectrum
  # i.e. 'y hat'. It is used later in the loss function (MSE)
  
  # theta is the parameter vector.
  #   the first 'n_peaks' terms of theta are the curve weights
  #   the remaining are the weights for the curves
  
  S <- rep(0, times=n)
  value <- rep(0,times=n)
  
  B <- theta[1:(n_peaks)]
  p <- theta[(n_peaks+1):(n+n_peaks)] # get just the spectrum (not the weights)
  B[1]<-1 # force scaling factor for reference peak to be unity
  
  
  for (i in 1:n_peaks) {
    for (j in 1:n){
      if (channel_numbers[i,j]==0){
        S[j]<- 0
      } else {
        S[j]<-p[channel_numbers[i,j]]
      } 
    }
    value <- value + B[i]*S
  }
  
  if(any(is.na(value))) {
    browser()
  }
  
  
  return(value)
}


loss_height <- function(ph,index,res,R,positions_index,peak_heights) {
  
  peak_heights[index] = ph
  
  tf = get_total_fit(res,R,positions_index,peak_heights)$total_fit
  
  return(sum(abs(R-tf)))
}


Q_height <- function(height,height_index,theta, R, n_peaks, n, channel_numbers, scaling_factors,max_channel) {
  
  theta[height_index] = height
  
  return(Q_theta(theta, R, n_peaks, n, channel_numbers, scaling_factors,max_channel))
  
}


Q_theta <- function(theta, R, n_peaks, n, channel_numbers, scaling_factors,max_channel) {
  # Define cost function for peak shape optimization, sum of squared residuals
  
  # magnify loss near the peaks
  
  return(max_channel*sum( ((R - H.Result(theta, n_peaks, n, channel_numbers))^2*scaling_factors) )) 
}


Q_pos <- function(positions_index, R, peaks, n_peaks, n, scaling_factors=1,max_channel){
  
  # Optimization function for peak location
  channel_numbers <- create_channel_numbers(positions_index, n_peaks, n)
  
  yhat <- H.Result(peaks$par, n_peaks, n, channel_numbers)
  
  f_val = max_channel*sum((R - yhat)^2*scaling_factors) 
  
  if(is.na(f_val)) {
    browser()
  }
  
  return(f_val)
}


create_channel_numbers <- function(positions_index, n_peaks, n){
  ## Function for generating the channel number matrix
  ## theta: peak position vector
  ## n_peaks: number of peaks
  ## n: number of channels
  peak_shift<-vector(mode="numeric", length=n_peaks)
  d<-rep(0,n_peaks)
  cvec<-vector(mode="numeric", length=n_peaks)
  
  
  # this is just converting the difference in tof to difference in indices
  for (i in 2:n_peaks){
    #peak_shift[i]<-theta[i]-theta[1]
    #peak_shift[i]<-round(peak_shift[i],3)
    #d[i]<-as.integer(abs(peak_shift[i]/bin_width))
    d[i] = positions_index[i] - positions_index[1] 
  }
  
  for (i in 2:n_peaks){
    cvec[i]<-(n-abs(d[i]))
  }
  
  channel_numbers <- matrix(0,nrow=n_peaks, ncol=n)
  channel_numbers[1, ] <- seq(from=1, to=n, by=1)
  
  for (i in 2:n_peaks){
    for (j in 1:cvec[i]){
      if (d[i]<=0){  
        channel_numbers[i,j]<-(j+abs(d[i]))
        
      } else {
        tryCatch({
          channel_numbers[i,(j+d[i])] <- j
        },
        error = function(e) {
          #browser()
          print("error in create_channel_numbers()")
        })
        
      }
    }
  }
  
  return(channel_numbers)
}


create_channel_numbers_orig <- function(theta, n_peaks, n, bin_width){
  ## Function for generating the channel number matrix
  ## theta: peak position vector
  ## n_peaks: number of peaks
  ## n: number of channels
  peak_shift<-vector(mode="numeric", length=n_peaks)
  d<-rep(0,n_peaks)
  cvec<-vector(mode="numeric", length=n_peaks)
  
  # this is just converting the difference in tof to difference in indices
  for (i in 1:n_peaks){
    peak_shift[i]<-theta[i]-theta[1]
    peak_shift[i]<-round(peak_shift[i],3)
    d[i]<-as.integer(abs(peak_shift[i]/bin_width))
    #d[i] = positions_index[i] - positions_index[1] - 1
  }
  
  for (i in 2:n_peaks){
    cvec[i]<-(n-d[i])
  }
  
  channel_numbers <- matrix(0,nrow=n_peaks, ncol=n)
  channel_numbers[1, ] <- seq(from=1, to=n, by=1)
  
  for (i in 2:n_peaks){
    for (j in 1:cvec[i]){
      if (peak_shift[i]<=0){  
        channel_numbers[i,j]<-(j+d[i])
        
      } else {
        tryCatch({
          channel_numbers[i,(j+d[i])] <- j
        },
        error = function(e) {
          browser()
        })
        
      }
    }
  }
  
  return(channel_numbers)
}


