summary.peak <- function(object){
  
  peak_form <- object$peak_object$spectra_results[1, ]
  
  peak_maximum <- max(peak_form)
  
  half_maximum <-peak_maximum / 2
  
  FWHM <- peak_form[peak_form >= half_maximum]
  
  n_channels_FWHM <- length(FWHM)
  
  isotopes <- object$par[1:object$peak_object$n_peaks]
  
  total <- sum(isotopes)
  
  abundance_scaling_factor_based <- isotopes / total
  
  max_channel <- max(object$peak_object$R)
  
  summits <- isotopes * max_channel
  
  SSR <- object$value
  
  summary_df <- data.frame(SSR=SSR, summits=summits, 
                           abundance_scaling_factor_based=abundance_scaling_factor_based, 
                           n_channels_FWHM=n_channels_FWHM)
  
  return(summary_df)
}


min_dist = function(x) {
  
  x = sort(x)
  
  min_dist = 1e10
  
  for(ii in 2:length(x)) {
    
    diff = abs(x[ii] - x[ii-1])
    
    if(diff < min_dist) {
      min_dist = diff
    }
  }
  
  return(min_dist)
}


