mov_avg = function(x,n,kernel='gaussian') {
  
  if(n %% 2 == 0) {
    n = n + 1
  }
  
  if(kernel == 'triangular') {
    
    w = 1:n
    med_ind = (n+1)/2
    w[(med_ind+1):n] = w[(med_ind-1):1]
    w = w/sum(w)
    
  } else if(kernel == 'gaussian') {
    
    w = 1:n
    med_ind = (n+1)/2
    w = w - w[med_ind]
    w = dnorm(w,sd=n/2)
    w = w/sum(w)
    
  } else if(kernel == 'constant') {
    
    w = rep(1/n,n)
    
  }
  
  out_x = stats::filter(x, w, sides = 2)
  na_inds = which(is.na(out_x))
  wing_length = length(na_inds)/2
  
  for(ii in 1:wing_length) {
    out_x[ii] = mean(x[1:(ii+wing_length)])
    out_x[length(x) + 1 - ii] = mean(x[length(x):(length(x) + 1 - ii - wing_length)])
  }
  
  
  return(out_x)
  
}


fit_reference_spectrum_pava = function(R,time_of_flight,positions_index,other_peak_inds) {
  
  # other_peak_inds will be ignored for fitting
  # other_peak_inds is assumed to be a boolean vector of length length(R)

  thedf = data.frame(x=time_of_flight,y=R^(1/4),rs=NA) # fit on a transformed scale
  
  peak_index = positions_index[1]
  
  # pava to the left and right of the peak
  inds_right = which( (1:length(R) >= peak_index) & !other_peak_inds )
  inds_left = which( (1:length(R) < peak_index) & !other_peak_inds )
  
  thedf$rs[inds_right] = Iso::pava(thedf$y[inds_right],decreasing=T)
  thedf$rs[inds_left] = Iso::pava(thedf$y[inds_left],decreasing=F)

  thedf$rs[is.na(thedf$rs)] = approx(x=thedf$x[!is.na(thedf$rs)],
                                     y=thedf$rs[!is.na(thedf$rs)],
                                     xout=thedf$x[is.na(thedf$rs)])$y

  
  thedf$rs = thedf$rs^4 # convert to original scale
  
  return(list(rs=thedf$rs))
  
  
}


fit_reference_spectrum = function(R,bkgd_limit,time_of_flight,positions_index) {
  
  n=length(R)
  reference_spectrum = rep(0,n)
  peak_index = positions_index[1]
  reference_spectrum = R
  
  # the pad is so that we don't fit the convex hull at the peak
  # and get a spiked or 'Laplace-looking' peak
  pad = round(length(R)/200)
  right_tail_inds = (peak_index+pad):n
  left_tail_inds = (peak_index-pad):1
  
  # get a smoothed version of the curve (still contains all peaks)
  reference_spectrum[-(peak_index + -pad:pad)] = mov_avg(R,round(length(R)/400),'triangular')[-(peak_index + -pad:pad)]
  
  # lower bound the counts where counts are below the bkgd_val
  # otherwise convex hull will drop to 0
  bkgd_noise = R[1:bkgd_limit]
  bkgd_val = mean(bkgd_noise)
  reference_spectrum[reference_spectrum < bkgd_val] = bkgd_val
  
  # get the convex hull of the right tail
  x = 1:length(right_tail_inds)
  y = reference_spectrum[right_tail_inds]
  res = chull(x,y^(1/4)) # does log do the best here? maybe, but a lot of counts might be 0
  #res = chull(x,log10(y))
  right_end = which.max(res)
  the_ind = right_end
  keep_going = TRUE
  while(keep_going && the_ind < length(res)) {
    the_ind = the_ind + 1
    if(res[the_ind]>res[the_ind-1]) {
      the_ind = the_ind - 1
      keep_going = FALSE
    }
  }
  
  res = res[the_ind:right_end]
  
  res_interp = approx(res,(y[res])^(1/4),x)
  reference_spectrum[right_tail_inds] = (res_interp$y)^4
  
  
  # be sure monotonic
  for(ii in (peak_index+1):n) {
    if(reference_spectrum[ii-1] > reference_spectrum[ii]) {
      # do nothing
    } else{
      reference_spectrum[ii] = reference_spectrum[ii-1]
    }
  }
  
  # make left side monotonic as well
  for(ii in (peak_index-1):1) {
    if(reference_spectrum[ii] < reference_spectrum[ii+1]) {
      # do nothing
    } else{
      reference_spectrum[ii] = reference_spectrum[ii+1]
    }
  }
  
  reference_spectrum[positions_index[1] + -pad:pad] = R[positions_index[1] + -pad:pad]
  
  return(list(rs=reference_spectrum,
              bv=bkgd_val))
  
}


get_constrained_inds = function(R,
                                time_of_flight,
                                positions_index,
                                fit_hydride_peaks) {
  
  # first, calculate trendline, then get an estimate of the
  # standard deviation about this line.
  
  peak_index = positions_index[1]
  
  # first, find a decreasing fit that should not fit the peaks
  R_smooth = sqrt(R)
  
  # we don't want the running min to drop too low, so we'll first put a floor on the data,
  # where the floor is the median of the end of the spectrum
  tail_med = median(R_smooth[(length(R) - round(length(R)/20)):length(R)])
  R_smooth[R_smooth < tail_med] = tail_med
  R_smooth[peak_index:length(R)] = get_running_min(R_smooth[peak_index:length(R)])
  R_smooth = R_smooth**2
  
  # then, we look at the residuals between R and R-smooth 
  resids = sqrt(R) - sqrt(R_smooth)
  resids = resids[peak_index:length(R)]
  good_resids = resids[!(is.na(resids) | is.nan(resids) | is.infinite(resids))]
  sd_est = mad(good_resids) # using mad so it isn't influenced by peaks
  above_sd_est = resids > 1.5*sd_est
  
  # now, look where we have consistent deviation beyond the MAD estimate,
  # and those should tell us where peaks are
  ones_in_a_row = rep(0,length(R))
  
  for(ii in peak_index:length(R)) {
    
    if( !above_sd_est[ii-peak_index+1] ) {
      ones_in_a_row[ii] = 0
      
    } else {
      ones_in_a_row[ii] = ones_in_a_row[ii-1] + 1
    }
    
  }
  
  # if there are 'cutoff' or more residuals in a row
  # that fall above the standard deviation, there is probably a peak.
  
  cutoff = round(length(R)/150) # evaluates to 13 for a spectrum of length 2000
  where_are_the_peaks = ones_in_a_row > cutoff
  
  # need to add back in 'TRUE' for the start of the deviation
  peak_starts = c(FALSE,which(diff(where_are_the_peaks) == 1)) # add false since diff chops off 1st index
  peak_starts = peak_starts[peak_starts > cutoff] # no hydrides at the far left of the spectrum
  
  for(ii in 1:length(peak_starts)) {
    where_are_the_peaks[peak_starts[ii] - 0:(cutoff*2)] = TRUE # add an extra 'cutoff' just to be conservative
  }
  
  peak_ends = c(FALSE,which(diff(where_are_the_peaks) == -1))
  peak_ends = peak_ends[peak_ends < length(R) - cutoff]
  
  for(ii in 1:length(peak_ends)) {
    where_are_the_peaks[peak_ends[ii] + 0:cutoff] = TRUE
  }
  
  # now we need to find the hydride peaks.
  # We will find the user-selected peaks,
  # and then set those peak indices to FALSE.
  # Only the hydride peaks should remain.
  hydride_peaks = where_are_the_peaks
  
  for(ii in 2:length(positions_index)) {
    
    if(positions_index[ii] > positions_index[1]) {
      
      if(where_are_the_peaks[positions_index[ii]] == TRUE) {
        
        # peaks where the user has indicated a peak
        # are not assumed to be potential hydride peaks
        hydride_peaks[positions_index[ii]] = FALSE
        
        # do the right side of the peak
        keep_going = TRUE
        index = positions_index[ii]
        
        while(keep_going & index < length(R)) {
          
          index = index + 1
          
          if(where_are_the_peaks[index] == TRUE) {
            hydride_peaks[index] = FALSE
            
          } else {
            keep_going = FALSE
          }
          
        }
        
        # now to the left
        keep_going = TRUE
        index = positions_index[ii]
        
        while(keep_going & index > 1) {
          
          index = index - 1
          
          if(where_are_the_peaks[index] == TRUE) {
            hydride_peaks[index] = FALSE
            
          } else {
            keep_going = FALSE
          }
          
        }
        
      }
      
    }
    
  }
  
  if(fit_hydride_peaks) {
    where_to_constrain = where_are_the_peaks & !hydride_peaks
  } else {
    where_to_constrain = where_are_the_peaks 
  }
  
  return(list(where_to_constrain=where_to_constrain,
              hydride_peaks=hydride_peaks,
              non_hydride_peaks=where_are_the_peaks & !hydride_peaks))
}


estimate_tail_sigmoidal = function(reference_spectrum,
                                   R,
                                   time_of_flight,
                                   positions_index,
                                   bkgd_val,
                                   bkgd_limit) {

  
  main_peak_index = positions_index[1]
  
  smooth_R = mov_avg(R,round(length(R)/100))
  
  running_min = smooth_R
  
  # First, guess where the 'anchor' of the 
  # tallest peak is. This is either where 
  # the tallest peak hits the background noise directly,
  # or where it hits a left-side peak.
  
  tail_limit_guess = 0
  run_length = 0
  curr_index = main_peak_index - 1 
  curr_min = smooth_R[main_peak_index]
  
  right_pad = round(length(R)/40)
  
  while(curr_index > 1) {
    
    if(smooth_R[curr_index] >= curr_min) {
      run_length = run_length + 1
      
    } else {
      curr_min = smooth_R[curr_index]
      run_length = 0
    }
    
    # run length is how many values we have 
    # seen in a row past the running minimum (to the left)
    if(run_length >= 10) {
      tail_limit_guess = min(curr_index + right_pad,main_peak_index)
      break
    }
    
    curr_index = curr_index - 1
    
  }
  
  # tail limit guess is the 'anchor'
  reference_spectrum[1:tail_limit_guess] = bkgd_val
  
  tail_extension_rhs = tail_limit_guess # to return
  
  main_peak_index = positions_index[1]
  
  data = data.frame(intensity=c(R[tail_limit_guess:positions_index[1]]))
  data$time = c(tail_limit_guess:positions_index[1])
  data$intensity = sqrt(data$intensity)
  
  u_shelf = sqrt(R[positions_index[1]])
  l_shelf = sqrt(bkgd_val)
  the_med = l_shelf/2
  x_0 = data$time[which.min(abs(data$intensity - the_med))]
  
  fn_k = function(k,x,u_shelf,x_0,target) {
    
    preds = (u_shelf - l_shelf)/(1 + exp(-k*(x-x_0))) - (u_shelf - l_shelf)
    
    return( mean( (preds - target)**2 ) )
    
  }
  
  fn_x0 = function(x_0,x,u_shelf,k,target) {
    
    preds = (u_shelf - l_shelf)/(1 + exp(-k*(x-x_0))) - (u_shelf - l_shelf)
    
    return( mean( (preds - target)**2 ) )
    
  }
  
  slope_guess = abs(diff(range(data$intensity))/diff(range(data$time)))
  
  
  res_k = optimize(f=fn_k,interval=c(slope_guess/20,slope_guess*20),
                   x=data$time,u_shelf=u_shelf,x_0=x_0,target=data$intensity,
                   maximum = FALSE)
  
  pad = round(length(R)/100)
  
  res_x0 = optimize(f=fn_x0,interval=c(x_0 - pad, x_0 + pad),
                    x=data$time,u_shelf=u_shelf,k=res_k$minimum,
                    target=data$intensity,
                    maximum=FALSE)
  
  res_k = optimize(f=fn_k,interval=c(res_k$minimum/5,res_k$minimum*5),
                   x=data$time,u_shelf=u_shelf,x_0=x_0,target=data$intensity,
                   maximum = FALSE)
  
  
  reference_spectrum[1:tail_limit_guess] = exp( (u_shelf - l_shelf)/(1 + exp(-res_k$minimum*(1:tail_limit_guess-res_x0$minimum))) - (u_shelf - l_shelf) )
  
  return(list(tail_limit_guess = tail_limit_guess,
              tail_extension_rhs = tail_extension_rhs,
              reference_spectrum = reference_spectrum))
}


estimate_tail = function(reference_spectrum,
                         R,
                         time_of_flight,
                         positions_index,
                         bkgd_val,
                         method='linear') {
  
  main_peak_index = positions_index[1]
  running_min = R
  
  # First, guess where the 'anchor' of the 
  # tallest peak is. This is either where 
  # the tallest peak hits the background noise directly,
  # or where it hits a left-side 'bump'.
  
  tail_limit_guess = 0
  run_length = 0
  curr_index = main_peak_index - 1 
  curr_min = R[main_peak_index]
  
  run_length_limit = round(length(R)/100)
  right_pad = round(2*run_length_limit)
  
  # start at main peak, and go left
  while(curr_index > 1) {
    
    if(R[curr_index] >= curr_min) {
      run_length = run_length + 1
      
    } else {
      curr_min = R[curr_index]
      run_length = 0
    }
    
    # run length is how many values we have 
    # seen in a row past the running minimum (to the left)

    if(run_length >= run_length_limit) {
      tail_limit_guess = curr_index + right_pad
      break
    }
    
    curr_index = curr_index - 1
    
  }
  
  if(tail_limit_guess > main_peak_index) {
    warning("Linear tail extension may be unstable.")
    tail_limit_guess = main_peak_index - right_pad
  }
  
  # tail limit guess is the 'anchor'
  reference_spectrum[1:(tail_limit_guess-1)] = bkgd_val
  tail_extension_rhs = tail_limit_guess # save to return
  
  # get slope from peak to tail limit guess
  # 10 is just padding
  half_pk_to_tlg = round( (main_peak_index - tail_limit_guess)/2 )
  dy = ((R[main_peak_index - half_pk_to_tlg])^(1/4) - (R[tail_limit_guess])^(1/4))
  dx = (main_peak_index - half_pk_to_tlg) - (tail_limit_guess)
  avg_slope = dy/dx

  # extend line from main peak through the anchor point
  # (tail_limit_guess) until you hit the background value, 
  # using the average slope computed above
  curr_index = tail_limit_guess 
  
  if(tail_limit_guess > 1) {
    curr_val = reference_spectrum[curr_index]
    reference_spectrum[curr_index] = curr_val
    
    curr_index = curr_index - 1
    curr_val = (curr_val^(1/4) - avg_slope)^4
    
    # previously this was curr_val > bkgd_val, but we decided to extend to hit 0
    while( curr_val > 0 & curr_index > 1 ) {
      
      reference_spectrum[curr_index] = curr_val
      curr_index = curr_index - 1
      curr_val = (curr_val^(1/4) - avg_slope)^4
      
    }
    
    tail_limit_guess = curr_index + 1
    
  }
  
  reference_spectrum[1:tail_limit_guess] = 0 # force peak to be 0
    
 if(method == 'sigmoidal') {
    
    my_logistic2_loss = function(theta,x,y,min_val,max_val) {
      return( sum((mylogistic2(theta,x,min_val,max_val) - y)**2) )
    }
    
    min_val = sqrt(bkgd_val)
    max_val = sqrt(reference_spectrum[main_peak_index])
    
    x_range = tail_limit_guess:main_peak_index
    median_x = round( (tail_limit_guess + main_peak_index)/2 )
    
    res_optim = optim(c(avg_slope,median_x),
                      x = x_range,
                      y = sqrt(reference_spectrum[x_range]),
                      min_val=min_val,
                      max_val=max_val,
                      fn=my_logistic2_loss,
                      method = 'L-BFGS-B',
                      lower = c(0,-Inf),
                      upper = c(Inf,Inf))
    
    
    reference_spectrum[1:main_peak_index] = exp(mylogistic2(res_optim$par,
                                                           1:positions_index[1],
                                                           min_val,
                                                           max_val))
    
  }
  
  
  return(list(tail_limit_guess = tail_limit_guess,
              tail_extension_rhs = tail_extension_rhs,
              reference_spectrum = reference_spectrum))
}



center_peaks = function(R,time_of_flight,positions) {
  # This function checks around the user-input peak initializations in case
  # there is an obvious maximum right nearby. The algorithm will still optimize
  # the peaks, but this just gives a better start.
  
  positions_index = rep(0,length(positions))
  padding = round(length(R)/400) 
  smoothed_R = mov_avg(R,padding,'triangular') # smooth out random fluctuations
  
  for(ii in 1:length(positions)) { 
    positions_index[ii] = which.min(abs(time_of_flight - positions[ii]))
    
    curr_val = smoothed_R[positions_index[ii]]
    left_val = smoothed_R[positions_index[ii] - 1]
    right_val = smoothed_R[positions_index[ii] + 1]
    is_max = left_val < curr_val && curr_val > right_val
    
    max_iter = 10
    iter_index = 1
    
    # perform greedy search either to the left or right by one step
    # note we can't just use "which.max" since that isn't greedy
    
    while(!is_max && iter_index < max_iter) {
      
      iter_index = iter_index + 1
      
      # move right if right value is greater
      if(right_val > curr_val) {
        positions_index[ii] = positions_index[ii] + 1
        left_val = curr_val
        curr_val = right_val
        right_val = smoothed_R[positions_index[ii] + 1]
        
      # move left if left value is greater
      } else if(left_val > curr_val) {
        positions_index[ii] = positions_index[ii] - 1
        right_val = curr_val
        curr_val = left_val
        left_val = smoothed_R[positions_index[ii] - 1]
      
      } 
      
      # if we've found the local max, the loop will break
      is_max = left_val < curr_val && curr_val > right_val
      
    }
    
  }
  
  # peak height starts and lower bounds
  b_start = smoothed_R[positions_index]/max(smoothed_R)
  b_low = b_start*(10e-5)
  
  
  return(list(b_start=b_start,
              b_low=b_low,
              positions_index = positions_index))
}


slow_smooth = function(full_x,inds,window,rhs=TRUE,smth_ramp=1/8,log_scale=F,hydride_peaks) {
  
  if( window %% 2 == 0 ) {
    window = window + 1
  }
  
  if(log_scale) {
    full_x = sqrt(full_x)
  }

  
  smooth_x = mov_avg(full_x,window,'gaussian')
  #res_loess = lowess(full_x,f=.1)
  
  #smooth_x = res_loess$y
  
  q1 = round(length(inds)*smth_ramp)
  q3 = round(length(inds) - q1)
  
  if(rhs) {
    weights = c( mylogistic(seq(-4,4,length.out = q1)), rep(1,q3-q1), mylogistic(seq(4,-4,length.out = length(inds)-q3)))
    
  } else {
    weights = c( mylogistic(seq(-4,4,length.out = q1)), rep(1,length(inds)-q1))
  }
  
  
  #plot(weights)
  
  out_x = full_x
  out_x[inds] = full_x[inds]*(1-weights) + smooth_x[inds]*(weights)
  out_x[hydride_peaks] = full_x[hydride_peaks]
  
  if(log_scale) {
    out_x = exp(out_x)
  }
  
  return(out_x)
}


mylogistic = function(x) {
  return(1/(1+exp(-x)))
}

mylogistic2 = function(theta,x,min_val,max_val) {
  
  # theta[1]: slope
  # theta[2]: shift
  
  return( (max_val-min_val)/(1+exp(-theta[1]*(x-theta[2]) )) + min_val )
  
}

max_filter = function(x) {
  
  out_x = x
  
  inds = 1:11
  index = 6
  
  while(max(inds) <= length(x)) {
    
    out_x[index] = max(x[inds])
    inds = inds + 1
    index = index + 1
    
  }
  
  #out_x[1:2] = max(x[1:2])
  #out_x[(length(x)-1):length(x)] = max(x[(length(x)-1):length(x)])
  
  return(out_x)
}

get_running_min = function(x) {
  
  x_out = x
  
  curr_min = x[1]
  
  for(ii in 1:length(x)) {
    
    if(x[ii] < curr_min) {
      curr_min = x[ii]
      
    } else {
      x_out[ii] = curr_min
    }
    
  }
  
  return(x_out)
  
}

create_out_table = function(res) {
  
  n_peaks = length(res$new_pos)
  
  tofs = res$peak_object$spectrum_data[res$peak_object$begin_range:res$peak_object$end_range,][res$new_pos,1]
  
  phs = round(res$par[1:n_peaks]/max(res$par[1:n_peaks]),4)
  ras = round(res$par[1:n_peaks]/sum(res$par[1:n_peaks]),4)
  
  outdf = data.frame('pi'=round(res$new_pos,0),
                     'pltof'=round(as.vector(tofs),2),
                     'ra'=ras,
                     'ph'=phs,
                     'sf'=res$peak_object$max_channel)
  
  colnames(outdf) = c("Peak Index","Peak Location (Time of Flight)","Relative Abundance","Peak Heights (Scaled)","Normalization Factor")
  
  return(outdf)
  
}

